import { useState } from "react";
import { Checkbox } from "semantic-ui-react";
import { Spot } from "../resources/MapResources";


type SpotPopupProps = {
    spot: Spot;
}

const SpotPopup: React.FC<SpotPopupProps> = (props) => {
    const [checked, setChecked] = useState<boolean>(props.spot);

    return(
        <>
            <h3>
                {props.spot.name}
            </h3>
            <p>
                <em>{props.spot.recommendations}</em>
            </p>
            <Checkbox label='Visted' slider checked={checked}  />
            <p>
                {`${props.spot.lat}, ${props.spot.lon}`}
            </p>
        </>
    )
};

export default SpotPopup;
